];

const SlideShow = () => {
    return (
      <div>
        <Slide easing="ease">
          <div className="eachSlide">
          <img src= {slideImages[0]} />





          <img src= {slideImages[2]} />
          </div>
        </Slide>
        <Slide>
        <img src= {slideImages[1]} />
        </Slide>
      </div>
    )
};

